import React, { Suspense } from "react";
import { unstable_createResource as createResource } from "react-cache";

import { PetsSkeleton } from "./shared/PetsSkeleton";
import { PetsList } from "./shared/PetsList";

import { fetchPets } from "../service/petsApi";

export const SuspenseFetchData = () => {
  return (
    <Suspense fallback={<PetsSkeleton />} maxDuration={2000}>
      <Pets />
    </Suspense>
  );
};

const petsResource = createResource(fetchPets);

const Pets = () => {
  const pets = petsResource.read();
  return <PetsList pets={pets} />;
};
